import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { initCatalog } from '../actions/catalogAction'; // Import your action creator
import ProductCard from './ProductCard'; // Import your ProductCard component

function Catalog() {
  const dispatch = useDispatch();
  const products = useSelector((state) => state.catalog.products);

  // Fetch initial catalog data when the component mounts
  useEffect(() => {
    // Dispatch the initCatalog() action creator to fetch products
    dispatch(initCatalog());
  }, [dispatch]); // The dependency array ensures this effect runs once on mount

  return (
    <div>
      <h2>Catalog</h2>
      <div className="product-list">
        {products.map((product) => (
          // Render ProductCard for each product
          <ProductCard
            key={product.id} // Make sure each card has a unique key
            product={product}
          />
        ))}
      </div>
    </div>
  );
}

export default Catalog;
